INSERT INTO `acciones` (`idAcciones`, `accion`, `Proyectotec_idProyectotec`, `departa_id`, `clave`, `control`, `idperiodo`) VALUES
(1, 'COORDINAR LA INTEGRACIÓN Y EJECUCIÓN DE UN PROGRAMA DE FORMACIÓN DOCENTE MEDIANTE UN DIAGNÓSTICO DE CAPACITACIÓN POR ÁREA ACADÉMICA Y PROGRAMA DE ESTUDIO.', 18, 6, '03.1.1', 1, 3),
(2, 'OPERAR UN PROGRAMA PARA LA ACREDITACIóN DEL IDIOMA INGLES DE DOCENTES Y ESTUDIANTES EN EL NIVEL B1, DEL MARCO COMUN EUROPEO DE REFERENCIA PARA LAS LENGUAS', 1, 11, '36.8.5', 1, 3),
(3, 'ATENDER LAS RECOMENDACIONES DE CACECA PARA MANTENER LA ACREDITACIÓN DE LA INGENIERÍA EN GESTIÓN EMPRESARIAL Y LA LICENCIATURA EN ADMINISTRACIÓN', 11, 5, '05.2.1', 2, 3),
(4, 'INTEGRAR UN PROGRAMA DE DISEñO E INNOVACIóN CURRICULAR PARA LAS ESPECIALIDADES DE INGENIERíA EN GESTIóN EMPRESARIAL, LICENCIATURA EN ADMINISTRACIóN E INGENIERíA EN SISTEMAS COMPUTACIONALES', 12, 6, '04.2.1', 1, 3),
(5, 'COORDINAR LAS ACTIVIDADES RELACIONADAS CON LA GESTION, PROMOCIóN, REGISTRO Y SEGUIMIENTO DE LAS DIFERENTES CONVOCATORIAS DE BECAS ESTUDIANTILES DE PROGRAMAS FEDERALES Y ESTATALES.', 21, 13, '12.4.2', 1, 3),
(6, 'OPERAR UN PLAN DE TRABAJO PARA EL DESPLIEGUE DEL MODELO TALENTO EMPRENDEDOR, EVENTO NACIONAL DE INNOVACIÓN TECNOLÓGICA, Y EVENTOS DE EMPRENDEDURISMO.', 3, 11, '30.7.5', 2, 3),
(7, 'OPERAR UN PROGRAMA DE DIFUSIóN PARA LA OFERTA EDUCATIVA A ASPIRANTES DE EDUCACIóN DE NIVEL MEDIO SUPERIOR.', 8, 6, '13.4.2', 2, 3),
(8, 'GESTIONAR LAS PROGRAMAS DE ACTIVACIÓN FÍSICA, TORNEOS INTERNOS Y PARTICIPACIÓN EN LIGAS ESTATALES PARA EL RECLUTAMIENTO DE TALENTOS DEPORTIVOS Y SU INTEGRACIÓN A LOS EQUIPOS REPRESENTATIVOS.', 23, 2, '16.5.3', 1, 3),
(9, 'ASEGURAR EL CUMPLIMIENTO DE OBLIGACIONES FISCALES, BIENES MUEBLES, RECURSOS HUMANOS, DOCUMENTAR Y PUBLICAR EL INFORME DE RENDICIóN DE CUENTAS, ASÍ COMO REALIZAR LA GESTIÓN Y SEGUIMIENTO DE PROYECTOS INSTITUCIONALES', 17, 7, '41.9.6', 1, 3),
(10, 'RECERTIFICAR EL SGC A LA VERSIóN 2015 DEL PROCESO EDUCATIVO DEL INSTITUTO TECNOLóGICO DE TLAXIACO E INTEGRAR LA PROPUESTA DEL SISTEMA INTEGRAL DE GESTIóN', 15, 14, '37.9.6', 1, 3),
(11, 'OPERAR EL PROGRAMA DE MANTENIMIENTO PREVENTIVO Y CORRECTIVO ANUAL, ASí COMO EL SUMINISTRO PARA ATENDER EL PROCESO ADMISNITRATIVO', 22, 15, '09.4.2', 2, 3),
(12, 'COORDINAR Y OPERAR UN PROGRAMA DE PARTICIPACIóN EN EL EVENTO NACIONAL ESTUDIANTIL DE CIENCIAS, SEMANA NACIONAL DE CIENCIA Y TECNOLOGíA, SEMANAS ACADéMICAS DE LICENCIATURA E INGENIERíAS, EXPOSICIóN DE PRODUCTOS ACADéMICOS', 5, 3, '25.6.4', 1, 3),
(13, 'OPERAR PROGRAMAS INSTITUCIONALES DE: TUTORíA, TITULACIóN INTEGRAL, SALIDA LATERAL Y MOVILIDAD ESTUDIANTIL', 7, 6, '11.4.2', 1, 3),
(14, 'GARANTIZAR LA OPERACIóN ADMINISTRATIVA DE LA INSTITUTCIóN', 22, 1, '09.4.2', 3, 3),
(15, 'OPERAR UN PROGRAMA DE COMUNICACIóN E IMAGEN INSTITUCIONAL EN MEDIOS MASIVOS DE COMUNICACIóN COMO RADIO, TELEVISIóN, MEDIOS ELECTRóNICOS E IMPRESOS DE LAS DIFERENTES CARRERAS QUE OFERTA EL TECNOLóGICO EN LA REGIóN Y EL ESTADO; ASí COMO LOS LOGROS DE LAS ACTIVIDADES ACADéMICA, SOCIALES, DEPORTIVAS,CíVICAS, ENTRE OTRAS QUE REALIZA EL ESTUDIANTE PARA SU FORMACIóN INTEGRAL', 8, 8, '13.4.2', 1, 3),
(16, 'COORDINAR Y FORTALECER EL PROGRAMA INSTITUCIONAL DE FOMENTO A LA LECTURA PARA FOMENTAR LA FORMACIóN INTEGRAL DE LOS ESTUDIANTES MEDIANTE LA PARTICIPACIóN EN EVENTOS LOCAL, ESTATAL Y NACIONAL', 24, 9, '19.5.3', 1, 3),
(17, 'ATENDER LAS RECOMENDACIONES DE CACECA PARA MANTENER LA ACREDITACIÓN DE LA INGENIERÍA EN GESTIÓN EMPRESARIAL Y LA LICENCIATURA EN ADMINISTRACIÓN', 11, 10, '05.2.1', 2, 3),
(18, '244 COORDINAR LA INTEGRACIÓN Y EJECUCIÓN DE UN PROGRAMA DE FORMACIÓN DOCENTE MEDAINTE UN DIAGNÓSTICO DE CAPACITACIÓN INSTITUCIONAL, QUE CONSIDERE CERTIFICACIONES.', 9, 6, '02.1.1', 1, 3),
(19, 'MEJORAR LA CONECTIVIDAD A INTERNET A TRAVÉS DE LA CONTRATACIÓN DE UN SERVICIO DEDICADO', 13, 4, '08.3.1', 1, 3),
(20, ' ASEGURAR EL REGISTRO EN EL SISTEMA SIBISEP DE LOS BIENES MUEBLES E INSTRUMENTALES ASIGNADOS AL PLANTEL, Y GARANTIZAR EL SOPORTE DOCUMENTAL CONFORME A LA NORMATIVA VIGENTE', 2, 1, '42.9.6', 1, 3),
(21, 'CELEBRAR ACTOS CÍVICOS PROGRAMADOS CONFORME A LAS EFEMÉRIDES DEL CALENDARIO OFICIAL ASÍ COMO EN LOS EVENTOS ACADÉMICOS PROGRAMADOS EN EL INSTITUTO Y FUERA DEL MISMO, EN ATENCIÓN A LAS CONVOCATORIAS EMITIDAS POR LOS TRES ORDENES DE GOBIERNO, ASÍ COMO EL ENCUENTRO NACIONAL ESTUDIANTIL DE ESCOLTAS Y BANDAS DE GUERRA DEL TECNOLÓGICO NACIONAL DE MÉXICO, CELEBRADO CADA AÑO.', 20, 2, '18.5.3', 1, 3),
(22, 'OPERAR UN PROGRAMA PARA REALIZAR ESTUDIOS DE POSGRADO Y OBTENCIÓN DEL GRADO CON LA FINALIDAD DE CONSOLIDAR LOS CUERPOS ACADÉMICOS QUE PARTICIPEN EN REDES DE INVESTIGACIÓN NACIONALES E INTERNACIONALES', 6, 6, '01.1.1', 1, 3),
(23, 'DOCUMENTAR EVIDENCIAS PARA FINES DE ACREDITACIÓN DE ACUERDO AL MARCO REFERENCIAL DE CACEI DE LOS PROGRAMAS DE ESTUDIO DE INGENIERÍA EN SISTEMAS COMPUTACIONALES E INGENIERÍA INDUSTRIAL', 11, 5, '05.2.1', 1, 3),
(24, 'OPERAR UN PROGRAMA DE PROTECCIÓN CIVIL INSTITUCIONAL', 10, 14, '21.5.3', 1, 3),
(25, 'OPERAR UN PROGRAMA DE FORMACIóN DE CAPITAL HUMANO', 14, 12, '38.9.6', 1, 3),
(26, 'IMPLEMENTAR RECURSOS EDUCATIVOS EN AMBIENTES VIRTUALES DE APRENDIZAJE Y MOOCS A FIN DE GENERAR MATERIAL DIGITAL EDUCATIVO, ASÍ COMO HABILITAR UN CENTRO COMPLEMENTARIO DE APRENDIZAJE', 19, 6, '07.3.1', 1, 3),
(27, 'GESTIONAR LOS PROGRAMAS DE ACTIVACIÓN CULTURAL, FESTIVAL DE ARTE Y CULTURA INTERNO Y PARTICIPACIÓN EN EVENTOS POR INVITACIÓN DE DEPENDENCIAS E INSTITUCIONES PARA LA DETECCIÓN DE TALENTOS Y SU INTEGRACIÓN A LOS REPRESENTATIVOS.', 16, 2, '17.5.3', 1, 3),
(28, ' OPERAR UN PROGRAMA DE SEGUIMIENTO A EGRESADOS, INSERCIóN LABORAL Y DE VINCULACIóN INSTITUCIONAL ANTE ORGANISMOS PúBLICOS PARA LA REALIZACIóN DE RESIDENCIAS PROFESIONALES, SERVICIO SOCIAL Y PROYECTOS ACADéMICOS DE INVESTIGACIóN Y TECNOLOGíA', 4, 11, '34.7.5', 1, 3);
