INSERT INTO `lineas_accion` (`idLineas_accion`, `descripcion_accion`, `num_linea`) VALUES
(1, 'Impulsar la participación de los profesores en estudios de posgrado, nacionales e internacionales. ', 11),
(2, 'Incentivar al personal docente con estudios de posgrado inconclusos a la obtención del grado. ', 11),
(3, 'Promover el desarrollo docente y profesional del profesorado (formación, actualización y capacitación). ', 11),
(4, 'Promover el intercambio académico y la movilidad nacional e internacional mediante estancias científicas y tecnológicas en instituciones de educación superior, centros de investigación y en la industria. ', 11),
(5, 'Impulsar la formación de capital humano de excelencia que facilite el cambio generacional de la planta docente. ', 11),
(6, 'Promover la participación del profesorado en actividades de docencia, investigación, vinculación y gestión académica. ', 12),
(7, 'Impulsar al personal docente para la obtención del reconocimiento del perfil deseable. ', 12),
(8, 'Propiciar el trabajo colaborativo institucional del personal docente en las academias, cuerpos académicos y redes de investigación nacionales e internacionales, entre otros.', 12),
(9, 'Impulsar la participación del personal docente en actividades de formación, actualización y capacitación de recursos humanos. ', 12),
(10, 'Fortalecer el programa de estímulos al desempeño del personal docente.', 12),
(11, 'Impulsar la formación y la participación del personal docente en los procesos de evaluación y acreditación de programas educativos. ', 13),
(12, 'Impulsar la evaluación y acreditación de los programas educativos de licenciatura por organismos evaluadores, Comités Interinstitucionales para la Evaluación de la Educación Superior (CIEES) y acreditadores reconocidos por el Consejo para la Acreditación de la Educación Superior, A.C. (COPAES). ', 13),
(13, 'Promover la acreditación internacional de los programas educativos de licenciatura. ', 13),
(14, 'Solventar a corto y mediano plazo las observaciones que resulten de las evaluaciones de los programas educativos de licenciatura. ', 13),
(15, 'Impulsar la mejora de los indicadores de capacidad y competitividad académica de los programas educativos de licenciatura. ', 13),
(16, 'Asegurar la pertinencia y la actualización permanente de los programas educativos, según las necesidades sociales y de los diversos sectores de la economía.', 13),
(17, 'Promover que los programas de posgrado cumplan con los indicadores de ingreso y permanencia en el Programa Nacional de Posgrados de Calidad (PNPC). ', 14),
(18, 'Propiciar la evaluación, el seguimiento y la consolidación de los programas de posgrado. ', 14),
(19, 'Fomentar el desarrollo de la investigación en los institutos, unidades y centros, mediante el trabajo colaborativo institucional de los consejos y claustros, cuerpos académicos y redes de colaboración con otras instituciones de educación superior y de investigación, nacionales e internacionales. ', 14),
(20, 'Estimular la creación de posgrados especiales, interinstitucionales y multisedes, con la industria, en diferentes modalidades educativas. ', 14),
(21, 'Fomentar la participación de los institutos, unidades y centros en convocatorias nacionales e internacionales que impulsen la investigación científica y tecnológica. ', 14),
(22, 'Impulsar el uso del Consorcio Nacional de Información Científica y Tecnológica (CONRICyT) y otras bases de datos científicas. ', 14),
(23, 'Evaluar la pertinencia de la oferta educativa de conformidad con los requerimientos sociales y económicos, del desarrollo local, regional y nacional. ', 14),
(24, 'Impulsar el desarrollo de la oferta educativa en las modalidades no escolarizada –a distancia– y mixta, tanto para programas de estudios completos como para asignaturas específicas. ', 15),
(25, 'Promover la incorporación de nuevos recursos tecnológicos en la enseñanza, en especial, la producción y uso de cursos masivos abiertos en línea, para el desarrollo de capacidades propias de la sociedad del conocimiento. ', 15),
(26, 'Impulsar la inversión en las plataformas tecnológicas que requiere la educación en las modalidades no escolarizada –a distancia– y mixta. ', 15),
(27, 'Difundir el uso de las TIC y capacitar a los profesores en el uso de las TIC durante el proceso educativo. ', 15),
(28, 'Asegurar que en las modalidades no escolarizada –a distancia– y mixta, se provean servicios y apoyos a estudiantes y docentes. ', 15),
(29, 'Promover la investigación colegiada y multidisciplinaria del uso y desarrollo de las TIC aplicadas a la educación. ', 15),
(30, 'Establecer estrategias de seguimiento y evaluación de los resultados de los programas académicos en operación en las modalidades no escolarizada –a distancia– y mixta. ', 15),
(31, 'Utilizar las TIC para la formación de personal docente, directivo y de apoyo que participa en las modalidades escolarizada, no escolarizada –a distancia– y mixta. ', 15),
(32, 'Establecer criterios de aplicación general que faciliten el desarrollo de unidades de aprendizaje en línea. ', 15),
(33, 'Propiciar la formación de células de producción de materiales educativos y recursos digitales del TecNM. ', 15),
(34, 'Fomentar la participación de profesores y estudiantes en convocatorias académicas, de investigación e innovación en el plano internacional. ', 16),
(35, 'Fomentar el posicionamiento institucional en los rankings académicos mundiales. ', 16),
(36, 'Promover entre los profesores y estudiantes el dominio de una segunda lengua, preferentemente el idioma inglés, al menos el nivel B1, del Marco Común Europeo de Referencia para las Lenguas, o sus equivalentes. ', 16),
(37, 'Fomentar el intercambio académico de estudiantes y profesores a nivel internacional. ', 16),
(38, 'Fomentar la doble titulación con instituciones y universidades de prestigio internacional. ', 16),
(39, 'Impulsar la producción científica y tecnológica de alta calidad y la publicación de sus resultados en revistas indizadas. ', 16),
(40, 'Fomentar la creación de extensiones o nuevos institutos tecnológicos, particularmente en las regiones de mayor rezago. ', 21),
(41, 'Asegurar el máximo aprovechamiento de la capacidad instalada en los institutos tecnológicos y centros. ', 21),
(42, 'Ampliar la oferta educativa en sus diferentes modalidades y niveles, asegurando su pertinencia. ', 21),
(43, 'Gestionar los recursos materiales y humanos necesarios para atender el rezago e incrementar la cobertura en sus diferentes modalidades. ', 21),
(44, 'Difundir la oferta educativa de licenciatura y posgrado. ', 22),
(45, 'Impulsar la vinculación con instituciones educativas de nivel medio superior con el propósito de mejorar de manera continua el perfil de los aspirantes. ', 22),
(46, 'Difundir, orientar y gestionar oportunamente las convocatorias de becas y financiamiento educativo que permitan asegurar la permanencia de los estudiantes. ', 22),
(47, 'Fortalecer el Programa Nacional de Tutorías. ', 22),
(48, 'Establecer líneas de investigación educativa con la finalidad de conocer y resolver los problemas de reprobación y deserción de estudiantes. ', 22),
(49, 'Actualizar la normativa académica que asegure el reconocimiento parcial de estudios, salidas laterales y la movilidad estudiantil. ', 22),
(50, 'Impulsar mecanismos que permitan mejorar el proceso de titulación en los programas de licenciatura y de posgrado. ', 22),
(51, 'Asegurar el seguimiento a la trayectoria académica de los estudiantes del TecNM, con base en un sistema soportado por TIC. ', 22),
(52, 'Asegurar la incorporación y atención de estudiantes con perspectiva de género e inclusión de grupos vulnerables. ', 23),
(53, 'Fomentar la sana convivencia social con tolerancia e inclusión. ', 23),
(54, 'Impulsar esquemas de inclusión en la atención a los estudiantes. ', 23),
(55, 'Fortalecer la infraestructura educativa acorde con las necesidades de los grupos vulnerables. ', 23),
(56, 'Propiciar la participación de los estudiantes pertenecientes a grupos vulnerables en programas de apoyo. ', 23),
(57, 'Actualizar el marco normativo que asegure la inclusión de estudiantes de grupos vulnerables y con perspectiva de género. ', 23),
(58, 'Promover la participación de estudiantes en actividades deportivas y recreativas. ', 31),
(59, 'Incentivar la participación de los estudiantes en competencias deportivas en diferentes disciplinas y ámbitos. ', 31),
(60, 'Conformar equipos deportivos representativos del TecNM. ', 31),
(61, 'Gestionar la incorporación y formación de promotores y entrenadores deportivos. ', 31),
(62, 'Promover la colaboración con instituciones locales y nacionales, para potenciar la participación de estudiantes en actividades deportivas y recreativas. ', 31),
(63, 'Fomentar en los estudiantes y personal del TecNM la cultura integral de la nutrición y el cuidado de la salud, con especial referencia a la medicina preventiva. ', 31),
(64, 'Organizar y difundir eventos deportivos locales, regionales y nacionales. ', 31),
(65, 'Fortalecer la infraestructura para apoyar el desarrollo de actividades deportivas y recreativas. ', 31),
(66, 'Promover la participación de los estudiantes en actividades culturales, artísticas y cívicas en diferentes disciplinas y ámbitos. ', 32),
(67, 'Impulsar la organización y difusión de eventos culturales, artísticos y cívicos. ', 32),
(68, 'Promover, impulsar y preservar el patrimonio cultural, pictórico y de obra editorial de los institutos tecnológicos y centros. ', 32),
(69, 'Fomentar la cultura del aprecio a todas las expresiones de las bellas artes universales. ', 32),
(70, 'Promover círculos de lectura, de creación y apreciación literaria. ', 32),
(71, 'Conformar grupos culturales, artísticos y cívicos representativos del TecNM. ', 32),
(72, 'Difundir y preservar las expresiones de las culturas indígenas, de las tradiciones populares, y del arte urbano y comunitario. ', 32),
(73, 'Gestionar la incorporación y formación de promotores e instructores culturales, artísticos y cívicos. ', 32),
(74, 'Promover la colaboración con instituciones locales y nacionales, que fortalezcan la difusión de actividades culturales, artísticas y cívicas en los institutos, unidades y centros. ', 32),
(75, 'Fortalecer la infraestructura para apoyar el desarrollo de actividades culturales, artísticas y cívicas. ', 32),
(76, 'Promover la cultura de la prevención mediante las Comisiones de Seguridad e Higiene en el Trabajo. ', 33),
(77, 'Impulsar y fortalecer la cultura de prevención del delito, la violencia y la adicción a las drogas. ', 33),
(78, 'Impulsar, fortalecer y promover protocolos de atención a la sociedad en situaciones de emergencia y de desastres, para participar solidariamente con las autoridades de los tres niveles de gobierno. ', 33),
(79, 'Fomentar el cuidado sustentable del entorno y emprender acciones que contribuyan a mitigar el cambio climático. ', 33),
(80, 'Fomentar la práctica de los valores universales e institucionales. ', 34),
(81, 'Promover los valores de respeto y tolerancia para propiciar la sana convivencia y la erradicación de conductas antisociales. ', 34),
(82, 'Promover la participación de los estudiantes en las convocatorias con enfoque social. ', 34),
(83, 'Desarrollar las competencias interpersonales y ciudadanas de los estudiantes. ', 34),
(84, 'Promover la sinergia colaborativa interinstitucional para impulsar el máximo aprovechamiento de las capacidades científicas y tecnológicas de los institutos y centros del TecNM. ', 41),
(85, 'Fortalecer los mecanismos de vinculación y colaboración con otras instituciones de educación superior, centros de investigación y demás organismos nacionales e internacionales. ', 41),
(86, 'Orientar el desarrollo de la actividad científica, tecnológica y de innovación, con enfoque sustentable, hacia las áreas prioritarias regionales. ', 41),
(87, 'Promover las actividades de docencia e investigación en redes de colaboración científica y tecnológica. ', 41),
